	}
	function Closeletwo(n){
	     
		 document.getElementById("cir2_" + n).setAttribute("style", "visibility: visible");
		 if(n==1){
		 document.getElementById("mapI2").setAttribute("class","fil8");
		 document.getElementById("mapI1").setAttribute("class","fil7");}
		 else if (n==2){
		 document.getElementById("mapII1").setAttribute("class","fil6");
		 document.getElementById("mapII2").setAttribute("class","fil12");}
		 else if (n==3){
		 document.getElementById("mapIII1").setAttribute("class","fil14");
		 document.getElementById("mapIII2").setAttribute("class","fil16");
		 document.getElementById("mapIII3").setAttribute("class","fil13");
		 document.getElementById("mapIII4").setAttribute("class","fil15");
		 document.getElementById("mapIII5").setAttribute("class","fil17");
		 document.getElementById("mapIII6").setAttribute("class","fil10");
		 }
		 else if (n==4){
		 document.getElementById("mapIV1").setAttribute("class","fil11");
		 document.getElementById("mapIV2").setAttribute("class","fil18");}
		
	}
	function Hightlight(evt) {
         var object = evt.target;
         var cls = object.id;
		 
         var objectMap = document.getElementById("map"+cls);
		 ocls = objectMap.getAttribute("class") || object.className;
         objectMap.setAttribute("class","fil000");
   }
   
    function closeinfotip(n)
	{
	document.getElementById('infotip'+n).setAttribute("style","visibility:hidden");
	}
	
   function Recover(evt) {
         var object = evt.target;
		 var cls = object.id;
         var objectMap = document.getElementById("map"+cls);
		 objectMap.setAttribute("class",ocls);
	}
	function Hght(evt,n) {
         var object = evt.target;
         var cls = object.id;
		 for(var i=1;i<9;i++){
         var objectMap = document.getElementById("map"+cls+i);
		 ocls = objectMap.getAttribute("class") || object.className;
         objectMap.setAttribute("class","fil000");
		 }
   }
